--8.1
SELECT DATES.DAYNAME, SALES.SALEPRICE*SALES.QTY AS TOTAL_SALES
FROM A2DATEDATA DATES, DWSALE SALES
WHERE DATES.DATEKEY=SALES.SALE_DWDATEID
ORDER BY TOTAL_SALES DESC;
--8.2
SELECT CUST.CUSTCATNAME, SALES.SALEPRICE*SALES.QTY AS TOTAL_SALES
FROM DWCUST CUST, DWSALE SALES
WHERE CUST.DWCUSTID=SALES.DWCUSTID
ORDER BY TOTAL_SALES;
--8.3
SELECT PROD.PRODMANUNAME, SALES.QTY
FROM DWPROD PROD, DWSALE SALES
WHERE PROD.DWPRODID=SALES.DWPRODID
ORDER BY SALES.QTY DESC;
--8.4
SELECT CUST.DWCUSTID, CUST.FIRSTNAME, CUST.SURNAME, SALES.SALEPRICE*SALES.QTY AS TOTAL_SALES
FROM DWCUST CUST, DWSALE SALES
WHERE CUST.DWCUSTID=SALES.DWCUSTID AND ROWNUM < 11
ORDER BY TOTAL_SALES DESC;
--8.5
SELECT PROD.DWPRODID, PROD.PRODNAME, SALES.SALEPRICE*SALES.QTY AS TOTAL_SALES
FROM DWPROD PROD, DWSALE SALES
WHERE PROD.DWPRODID=SALES.DWPRODID AND ROWNUM < 11;
--8.6
SELECT CUST.STATE, CUST.CITY, SALES.SALEPRICE*SALES.QTY AS TOTAL_SALES
FROM DWCUST CUST, DWSALE SALES
WHERE CUST.DWCUSTID=SALES.DWCUSTID
ORDER BY TOTAL_SALES ASC;
